    return (
        <div className="flip-card">
            <div class="delete">
                <a href = "https://thumbs.dreamstime.com/b/delete-icon-vector-sign-symbol-isolated-white-background-logo-concept-your-web-mobile-app-design-133760264.jpg"></a>
            </div>
            <div className="flip-card-inner">
                <div className="flip-card-front">
                    {fronttext}
                </div>
                <div className="flip-card-back">
                    {backtext}
                </div>
            </div>
        </div>
    )
}
